import "./Home.css";

function Home() {
  return (
    <div className="home">
      <section className="header">
        <h1> Brandon Vincent </h1>
        <h2> Web developer/Software Engineer/Data Analyst </h2>
        <button> Read More </button>
      </section>
      <section className="qualifications"></section>
    </div>
  );
}

export default Home;
